// SPDX-License-Identifier: MIT
pragma solidity ^0.8.4;

import "./access/Ownable.sol";
import "./token/ERC20/ERC20.sol";
import "./token/ERC721/ERC721.sol";
import "./SsafyNFT.sol";

/**
 * PJT  - Req.1-SC1 SaleFactory 
 *    ,      .
 */
contract SaleFactory is Ownable {
    address public admin;
    address[] public sales;

    event NewSale(
        address indexed _saleContract,
        address indexed _owner,
        uint256 _workId
    );

    constructor() {
        admin = msg.sender;
    }

    /**
     * @dev   . 
     */
    function createSale(
        address seller,
        address buyer,
        uint256 itemId,
        uint256 purchasePrice,
        // uint256 minPrice,
        // uint256 startTime,
        // uint256 endTime,
        address currencyAddress,
        address nftAddress
    ) public returns (address) {
        // TODO
        Sale newContract = new Sale(admin, seller, buyer, itemId, purchasePrice, currencyAddress, nftAddress);
        emit NewSale(newContract.getAddress(), newContract.getSeller(), newContract.gettokenId());
        sales.push(newContract.getAddress());
        return newContract.getAddress();
    }

    function allSales() public view returns (address[] memory) {
        return sales;
    }
}

/**
 *  PJT  - Req.1-SC2) Sale 
 */
contract Sale {
    //    
    address public seller;
    address public buyer;
    address admin;
    // uint256 public saleStartTime;
    // uint256 public saleEndTime;
    // uint256 public minPrice;
    uint256 public purchasePrice;
    uint256 public tokenId;
    address public currencyAddress;
    address public nftAddress;
    bool public ended;

    //    
    address public highestBidder;
    uint256 public highestBid;

    IERC20 public erc20Contract;
    IERC721 public erc721Constract;

    event HighestBidIncereased(address bidder, uint256 amount);
    event SaleEnded(address winner, uint256 amount);

    constructor(
        address _admin,
        address _seller,
        address _buyer,
        uint256 _tokenId,
        //uint256 _minPrice,
        uint256 _purchasePrice,
        // uint256 startTime,
        // uint256 endTime,
        address _currencyAddress,
        address _nftAddress
    ) {
        require(_purchasePrice > 0); // _minPrice > 0
        tokenId = _tokenId;
        //minPrice = _minPrice;
        purchasePrice = _purchasePrice;
        seller = _seller;
        buyer = _buyer;
        admin = _admin;
        // saleStartTime = startTime;
        // saleEndTime = endTime;
        currencyAddress = _currencyAddress;
        nftAddress = _nftAddress;
        ended = false;
        erc20Contract = ERC20(_currencyAddress);
        erc721Constract = IERC721(_nftAddress);
    }

    function bid(uint256 bid_amount) public onlySeller { //onlyAfterStart
        // TODO
        // int256 success = getTimeLeft();
        // require(success > 0);
        require(erc20Contract.approve(buyer, bid_amount));
    }

    function purchase() public onlySeller{ // onlyAfterStart
        // TODO
        require(seller != msg.sender);
        require(erc20Contract.approve(buyer, purchasePrice));

        erc20Contract.transfer(buyer, purchasePrice); //      
        erc20Contract.approve(buyer, purchasePrice);
        
        erc721Constract.transferFrom(seller, buyer, tokenId); //erc721Constract // NFT  
        ended = true;//         ??
    }

    function confirmItem() public {
        // TODO 
    }
    
    function cancelSales() public{
        // TODO
        // int256 success = getTimeLeft();
        // require(success > 0);
        require(msg.sender == admin || msg.sender == seller);

        erc20Contract.transferFrom(buyer, seller, purchasePrice); // 
        erc721Constract.transferFrom(buyer, seller, tokenId);// NFT 
        ended = true;//    
    }

    function getAddress() public view returns (address){
        return address(this);
    }

    function getSeller() public view returns (address){
        return seller;
    }

    function gettokenId() public view returns (uint256){
        return tokenId;
    }

    // function getTimeLeft() public view returns (int256) {
    //     return (int256)(saleEndTime - block.timestamp);
    // }

    function getSaleInfo()
        public
        view
        returns (
            // uint256,
            // uint256,
            // uint256,
            uint256,
            uint256,
            //address,
            //uint256,
            address,
            address
        )
    {
        return (
            // saleStartTime,
            // saleEndTime,
            // minPrice,
            purchasePrice,
            tokenId,
            //highestBidder,
            //highestBid,
            currencyAddress,
            nftAddress
        );
    }

    // function getHighestBid() public view returns(uint256){
    //     return highestBid;
    // }

    // internal  private     _  .
    function _end() internal {
        ended = true;
    }

    function _getCurrencyAmount() private view returns (uint256) { 
        return erc20Contract.balanceOf(msg.sender); //     
    }

    // modifier       . 
    modifier onlySeller() {
        require(msg.sender == seller, "Sale: You are not seller."); 
        _;
    }

    // modifier onlyAfterStart() {
    //     require(
    //         block.timestamp >= saleStartTime,
    //         "Sale: This sale is not started."
    //     );
    //     _;
    // }
}
